INSERT INTO `shj_settings` VALUES ('concurent_queue_process','2'),('default_language_number','2'),('site_name','WECODE'),('timezone','Asia/Ho_Chi_Minh'),('tester_path','/home/ubuntu/wecode2/wecode-judge/tester'),('assignments_root','/home/ubuntu/wecode2/wecode-judge/assignments'),('file_size_limit','50000'),('output_size_limit','1024'),('queue_is_working','0'),('default_late_rule','/* \r\n * Put coefficient (from 100) in variable $coefficient.\r\n * You can use variables $extra_time and $delay.\r\n * $extra_time is the total extra time given to users\r\n * (in seconds) and $delay is number of seconds passed\r\n * from finish time (can be negative).\r\n *  In this example, $extra_time is 172800 (2 days):\r\n */\r\n\r\nif ($delay<=0)\r\n  // no delay\r\n  $coefficient = 100;\r\n\r\nelseif ($delay<=3600)\r\n  // delay less than 1 hour\r\n  $coefficient = ceil(100-((30*$delay)/3600));\r\n\r\nelseif ($delay<=86400)\r\n  // delay more than 1 hour and less than 1 day\r\n  $coefficient = 70;\r\n\r\nelseif (($delay-86400)<=3600)\r\n  // delay less than 1 hour in second day\r\n  $coefficient = ceil(70-((20*($delay-86400))/3600));\r\n\r\nelseif (($delay-86400)<=86400)\r\n  // delay more than 1 hour in second day\r\n  $coefficient = 50;\r\n\r\nelseif ($delay > $extra_time)\r\n  // too late\r\n  $coefficient = 0;'),('enable_c_shield','0'),('enable_cpp_shield','0'),('enable_py2_shield','0'),('enable_py3_shield','0'),('enable_java_policy','0'),('enable_log','0'),('submit_penalty','300'),('enable_registration','1'),('registration_code','0'),('mail_from','dhcntt@uit.edu.vn'),('mail_from_name','UIT Code Contest'),('reset_password_mail','<p>\r\nSomeone requested a password reset for your {SITE_NAME} Wecode Judge account at {SITE_URL}.\r\n</p>\r\n<p>\r\nTo change your password, visit this link:\r\n</p>\r\n<p>\r\n<a href=\"{RESET_LINK}\">Reset Password</a>\r\n</p>\r\n<p>\r\nThe link is valid for {VALID_TIME}. If you don\'t want to change your password, just ignore this email.\r\n</p>'),('add_user_mail','<p>\r\nHello! You are registered in http://thilaptrinh.uit.edu.vn/wecode Wecode Judge at http://thilaptrinh.uit.edu.vn/wecode as Student.\r\n</p>\r\n<p>\r\nYour username: {USERNAME}\r\n</p>\r\n<p>\r\nYour password: {PASSWORD}\r\n</p>\r\n<p>\r\nYou can log in at <a href=\"http://thilaptrinh.uit.edu.vn/wecode\">{LOGIN_URL}</a>\r\n</p>'),('moss_userid','1796'),('results_per_page_all','40'),('results_per_page_final','80'),('week_start','1'),('theme','default');
